import withLayout from '../components/Layout';
import Content from './p/[id]';



const Blog = () => {
  return (
    <>
      <h1>My Blog</h1>
      <ul>
        <Content id='hello-next.js' title="Learn to Hello" />
        <Content id='learn-next.js' title="Learn to Learn" />
        <Content id='deploy-next.js' title="Learn to Deploy" />
      </ul>
    </>
  )
} 

export default withLayout(Blog);
